  true,\n\t\"url\": null,\n\t\"notes\": \"The Airports Geographic Information System
  maintains the airport and aeronautical data required to meet the demands of the
  Next Generation National Airspace System. Guided by the program advisory circulars,
  the airport sponsor/proponent becomes a key link in the airport and aeronautical
  information chain. Through a single internet based web application the airport can
  access its data along with the ability to submit changes as required. The changes
  are processed according to defined business rules ensuring that the required FAA
  office making the changes is notified.\",\n\t\"license_title\": \"Other License
